Sourabh: #include<iostream>
using namespace std;
struct node{
        int data;
        struct node* left;
        struct node* right;
    };
    struct node* createnode(int data){
        struct node* n=new struct node;
        n->data=data;
        n->left=NULL;
        n->right=NULL;
        return n;
    }
    void inorder(struct node* root){
        if(root!=NULL){
            inorder(root->left);  // same for postorder
            cout<<root->data<<" "; // but in preorder :1.root->data 2.root->left 3.root->right 
            inorder(root->right);
        }
    }
int main(){
    struct node* p=createnode(23);
    struct node* p1=createnode(34);
    struct node* p2=createnode(45);
    struct node* p3=createnode(67);
    struct node* p4=createnode(89);

    p->left=p1;
    p->right=p2;
    p1->left=p3;
    p1->right=p4;
    inorder(p);
    return 0;
}

#include<iostream>
using namespace std;
struct node* head=NULL;
struct node{
int data;
struct node* next;
struct node* pre;  // remove in SLL and CLL
};
void createNode(){
    struct node* ptr=NULL,*current=NULL;
    char ch;
    cout<<"Creating linklist: ";
    do{
        ptr=new struct node;
        if(ptr==NULL){
            cout<<"Memory allocation faild\n";
            return ;
        }
        cout<<"Enter data ";
        cin>>ptr->data;
        ptr->next=NULL; // use both in CDLL
        ptr->pre=NULL;  // remove in SLL and CLL
        if(head==NULL){
           head=ptr;
           current=ptr;
        }
        else{
            current->next=ptr;
            ptr->pre=current; //use for doubly LL
            current=ptr;
        }
        // use for circular LL : current->next=head;
        // extra use for CDLL : head->pre=current;
        cout<<"Wanna enter more data  Y  or N\n";
        cin>>ch;
    }while(ch=='Y'||ch=='y');

    cout<<"Linklist is made successfuly\n";
}

void displayll(){
    struct node* ptr=head;
    cout<<"Link list: ";
    if (ptr == NULL)
    {
        cout<<"Nothing to print";
    }
    else
    {
    while(ptr!=NULL){ // for circular LL : ptr!=head
       cout<<ptr->data<<"<->";
       ptr=ptr->next;
    }
    }
}
int main(){
    createNode();
    displayll();
    return 0;
}
